webpackJsonp([32765110312016],{320:function(t,e){t.exports={pathContext:{posts:[{html:'<p>First, I <a href="https://aws.amazon.com">signed up for an AWS account</a>. (Have your credit card and phone ready for confirmation).</p>\n<p>Then I created my first <a href="https://aws.amazon.com/s3/">S3 bucket</a> (after years of hearing the phrase).\n<em>NOTE:</em> The bucket has to be named for your domain (In my case, <code>www.taylorlistens.com</code>).</p>\n<p>I don\'t need versioning or logging or tags, so I skipped that section of the setup.</p>\n<p>Since I\'m hosting a site, the bucket is set to grant public read access.</p>',id:"/Users/taylor/Documents/Projects/taylorlistens/src/pages/2017-09-13-getting-gatsby-hosted-on-aws/index.md absPath of file >>> MarkdownRemark",frontmatter:{date:"2017-09-14T03:36:12.423Z",path:"/getting-gatsby-hosted-on-aws",title:"Getting Gatsby Hosted On AWS",excerpt:"Spoiler: Like usual, it was way easier than I thought.",tags:["aws","gatsby"]}}],tagName:"aws"}}}});
